nique.be\/concert\/underscores-2023","ticketing_context_row":{"title":"Tickets","subtitle":"botanique.be\/concert\/underscores-2023"},"health_and_safety_details":[],"health_and_safety_details_other_requirements":[],"health_and_safety_details_user_location":"","event_host_context_row_info":{"icon_name":"friend-neutral","title":{"delight_ranges":[],"image_ranges":[],"inline_style_ranges":[],"aggregated_ranges":[],"ranges":[{"entity":{"__typename":"User","__isEntity":"User","__isActor":"User","id":"100064544355897","url":"https:\/\/www.facebook.com\/botaniquebxl","answer_agent_group_id":null,"profile_url":"https:\/\/www.facebook.com\/botaniquebxl","short_name":"Le Botanique","work_info":null,"__module_operation_CometTextWithEntitiesRelay_textWithEntities":{"__dr":"ProfileGeminiWeakReferenceLink_user$normalization.graphql"},"__module_component_CometTextWithEntitiesRelay_textWithEntities":{"__dr":"ProfileGeminiWeakReferenceLink.react"},"work_foreign_entity_info":null,"mobileUrl":"https:\/\/m.facebook.com\/botaniquebxl","__isNode":"User"},"entity_is_weak_reference":false,"length":12,"offset":9}],"color_ranges":[],"text":"Event by Le Botanique"}},"send_calendar_invite":false,"should_show_calendar_invite_preview":false,"display_duration":"2 hr","paid_virtual_event_info_box_content":null,"event_permalink_header_info_banner_content":null,"event_price_and_duration_context_row_info":{"title":{"text":"Duration: 2 hr"}},"can_share_room_link":false,"created_for_group":null,"content_geogating":null,"is_viewer_host":false,"event_creator":{"__typename":"User","name":"Le Botanique","id":"100064544355897"},"is_work_entity":false,"speakers_context_row_renderer":null,"parent_event":null,"event_description":{"text":"\u2014\u2014\u2014 UNDERSCORES (US)\n\nFR\/\nOriginaire de San Francisco, l'artiste am\u00e9ricaine d'origine philippine April Harper Grey a commenc\u00e9 \u00e0 faire de la musique sous le nom d'underscores au coll\u00e8ge, lorsque des ann\u00e9es \u00e0 jouer sur GarageBand ont abouti \u00e0 la r\u00e9alisation que, si elle \u00e9tait prise suffisamment au s\u00e9rieux, toute cette histoire d'\u00ab essayer d'\u00eatre comme Skrillex \u00bb pouvait d\u00e9boucher sur quelque chose de grand.\n\nEn 2021, underscores a sorti son premier album, \u00ab fishmonger \u00bb, reconnu par le public et les m\u00e9dias, ce disque lui permet d'assurer les premi\u00e8res parties de 100 Gecs. Cette premi\u00e8re mini-tourn\u00e9e s'est faite \u00e0 guichets ferm\u00e9s \u00e0 New York, Los Angeles, Chicago et San Francisco, sa ville natale. Depuis lors, elle a jou\u00e9 sur la sc\u00e8ne principale de Lollapalooza, Electric Forest, FVDED in the Park et Corona Capital CDMX. \n\nInd\u00e9pendante depuis la cr\u00e9ation du projet, underscores a sign\u00e9 chez Mom+Pop l'ann\u00e9e derni\u00e8re. Elle a \u00e9galement fait ses d\u00e9buts avec \u00ab Count of three (You can eat $#\u0040!) \u00bb - co-\u00e9crit avec Dylan Brady (de 100 Gecs), Cashmere Cat et Benny Blanco, et a produit de la musique pour Alice Longyu Gao, glaive, Whethan et renforshort.\n\nEN\/\nFor years, underscores released a steady stream of one-offs via SoundCloud, which endeared her to like minded artists and a burgeoning community of fans, but it wasn\u2019t until 2017, with the release of EP skin purifying treatment, that the project stepped out of its solitary origins and began to capture the attention of a much larger audience. In 2021, underscores released the debut underscores album, fishmonger, which was written and recorded in that same childhood bedroom amidst the COVID-19 pandemic. \n\nThat collection launched underscores from recording vocals in a car to opening for 100 Gecs on the U.S. leg of the 10,000 Gecs tour. Before hitting the road, underscores released yet another collection, boneyard aka fearmonger, a collection of seven tracks that manages to sound like both the climax of and the morning after the craziest night of your life.\n\nIndependent since the project\u2019s inception, underscores signed to Mom+Pop last year. She also debuted \u201cCount of three (You can eat $#\u0040!)\u201d \u2013 co-written with Dylan Brady (of 100 Gecs), Cashmere Cat, Benny Blanco \u2013 on 100 Gecs\u2019 Dog Show Records. Since dropping boneyard aka fearmonger, she\u2019s produced music for Alice Longyu Gao, glaive, Whethan, and renforshort. The world eagerly awaits the next underscores record, Wallsocket, knowing it will jolt us out of reverie. \n\n\n\u2014\u2014\u2014 FOR FANS OF\n\n100 gecs, glaive, Jane Remover\n\n\n\u2014\u2014\u2014 PRESS\n\n\"Dubstep renegade underscores is soundtracking the apocalpyse\" \u2014 Rolling Stone\n\n\n\u2014\u2014\u2014 INFOS\n\n\u2022 Witloof Bar \/ Doors 19:30\n\u2022 Bota'Carte 13,50\u20ac\nhttps:\/\/botanique.be\/botacarte\n\u2022 Tickets 16,50\u20ac\n\u2022 At the door 19,50\u20ac\n(costs included)\n\n\n\u2014\u2014\u2014 TICKETS\n\nFR: https:\/\/botanique.be\/fr\/concert\/underscores-2023\nNL: https:\/\/botanique.be\/nl\/concert\/underscores-2023\nEN: https:\/\/botanique.be\/en\/concert\/underscores-2023","delight_ranges":[],"image_ranges":[],"inline_style_ranges":[],"aggregated_ranges":[],"ranges":[{"entity":{"__typename":"ExternalUrl","__isEntity":"ExternalUrl","url":"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fbotanique.be\u00252Fbotacarte&h=AT15FGHELVY7cOWsjLGtCccr2c4Lc7r8-iYWI6PYbXGfOmHrrYWbT8_iJYijLOEEngVAh91M5JY0_38u-zJME4ADxDAnoaCcrKUP3oFjjY_caBl9KG3gIQIP34xRfYf70uFXFfglEowYmybJo-X0&s=1","external_url":"https:\/\/botanique.be\/botacarte","__isWebLinkable":"ExternalUrl","web_link":{"__typename":"ExternalWebLink","url":"https:\/\/botanique.be\/botacarte","fbclid":null,"lynx_mode":"ASYNCLAZY"},"mobileUrl":"https:\/\/lm.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fbotanique.be\u00252Fbotacarte&h=AT2kZruCcRh8A4kxWJy0XzgfvK0PdzGb5LOHSNrMd8-1gRpN27affjyL-PoR3Sy22V9gzd3bt1ec4j6LOVwwoukodgS80CPYN3b04rknyEtvnjlYmsdKEsrojOOwzAqP2QdNjoL4hYcpU4jCzPYE&s=1","__isNode":"ExternalUrl","id
